const SecondIndex = () => import('./ordinaryRewardInfo.vue');
import {
     getordinaryRewardListAPI
} from '@/api/ordinaryRewardAPI.js'
export default {
    name:'prodList',
    data(){
        return{
            form:{
                current:1,
                size:10,
            },
            amountTypeList:{
                1:"固定比例",
                2:"固定金额",
                3:"按单品设置"
            },
            sceneTypeList:{
                1:"代理加入",
                2:"代理升级"
            },
            rewardStateList:{
                1:"待结算",
                2:"待奖励",
                3:"已完成",
                4:"已失效"
            },
            ordinaryId:'',
            paymentId:'',
            shoptypelist:[{name:'全部',val:'1',nownum:''},{name:'待结算',val:'2',nownum:''},{name:'已完成',val:'3',nownum:''},{name:'已失效',val:'4',nownum:''}],
            keyword:"",
            tableData:[],
            totalCount:0,
            searchshow:false,
            secondDepShow:false,
            tableLoading:false,
        };
    },
    components:{
        SecondIndex
    },
    methods:{
        /**
         * @msg: 翻页
         * @param {type} 
         * @return: 
         */
        handleSizeChange(cSize) {
            this.form.size = cSize;
            this.getordinaryRewardList();
        },
        getordinaryRewardList(){
            const params = {...this.form};
            this.tableLoading = true;
             getordinaryRewardListAPI(params)
                .then(res => {
                    const data = res.data.data;
                    console.log(data)
                    this.totalCount = data.total;
                    this.tableData = data.records;
                    this.tableLoading = false;
                })
                .catch(err => {
                    this.tableLoading = false;
                })
        },
        handleCurrentChange(currentPage) {
            this.form.current = currentPage;
            this.getordinaryRewardList();
        },
        changedetailshow(){
            this.secondDepShow=true
        },
        changeirdubary(){
            // this.secondDepShow=true
        },
        errorMsg (message) {
            this.$message({
                message: message,
                type: 'error',
                duration: 1500
            })
        },
    },
    created(){
        this.getordinaryRewardList()
    }
}
